import { VStack, Heading } from "@chakra-ui/react";
import Message from "../components/Message";

const Conversation = () => {
  return (
    <>
      <Heading as='h2' size='lg'>Conversation</Heading>
      <VStack>
        <Message />
      </VStack>
    </>
  );
};

export default Conversation;
